window.bookSummaryJSON = "<p><b>Jingle bells. Mistletoe. Christmas cheer. And evil spirits.</b><br> <br> Kay Bishop is no stranger to the supernatural. As a Medium, spirits have always flocked to her like a beacon. But after a run-in with a demon and his Halfling creatures, Kay promised herself that this Christmas would be different...completely spirit-free and ordinary. But as usual, things don’t exactly go as planned....<br> <br> When a group of paranormal investigators unleash something dark and terrifying into the world, the evil follows Kay home after a holiday party, making her much-needed vacation week a living hell. Since Jade, her reaper best friend, is unreachable and busy with angel business, getting rid of this ghost is now Kay’s responsibility. But it’s not going anywhere without a fight.<br> <br> The lives of her family are in danger, and Kay quickly realizes she won’t be able to escape her gifts.... She’ll need to embrace them completely to save the ones she loves the most.<br> <br> <b>If only she doesn’t lose herself in the process.</b><br> <b> <br> Discover all the holiday magic wrapped up in the Reaper Reborn series by listening to </b><b><i>Christmas Spirits</i></b><b>.</b><br> <br> <b>Buy </b><b><i>Christmas Spirits</i></b><b> as an addition to this haunting and magical series today!</b></p>"; 
